/**
 *  PlasmaGigaAppTheme.Inverse
 */
@Composable
public fun PlasmaGigaAppTheme.Inverse(
    isDark: Boolean = isSystemInDarkTheme(),
    content: @Composable
    () -> Unit,
) {
    val colors = if (isDark) {
        darkInverseColors
    } else {
        lightInverseColors
    }
    val gradients = if (isDark) {
        darkInverseGradients
    } else {
        lightInverseGradients
    }
    PlasmaGigaAppTheme(
        colors = colors,
        gradients = gradients,
        content = content,
    )
}
